  oz_tutorial_camera_android_default_instruction: '<ul>\n    <li><div>In <b>Chrome</b>, click the menu button (<b>“three points”</b>).</div></li>\n    <li><div>Select <b>Settings</b>.</div></li>\n    <li><div>Scroll down the settings page and select <b>Site settings</b>.</div></li>\n    <li><div>Select <b>Camera</b>.</div></li>\n    <li><div>Switch on the <b>Camera</b> radio button.</div></li>\n</ul>',
  oz_tutorial_camera_android_default_title: 'Unfortunately, we haven’t recognized your browser. In case of <b>Chrome</b>, this problem can be solved as follows:',
  oz_tutorial_camera_android_edge_browser: 'Microsoft Edge',
  oz_tutorial_camera_android_edge_instruction: "<ul>\n<li><div>Hit the menu button (<b>“three stripes”</b> or <b>hamburger</b>) in the browser's lower right corner.</div></li>\n<li><div>Click <b>Settings</b>.</div></li>\n<li><div>Select <b>Privacy and security</b>.</div></li>\n<li><div>Select <b>Site settings</b> in the <b>Privacy</b> section.</div></li>\n<li><div>Choose <b>Camera</b> in <b>Permissions</b>.</div></li>\n<li><div>Set the <b>Camera</b> switcher to <b>On</b>.</div></li>\n</ul>",
  oz_tutorial_camera_android_edge_title: 'To enable access to the camera in <b>Microsoft Edge</b> on an Android device, proceed as follows:',
  oz_tutorial_camera_android_facebook_browser: 'Facebook',
  oz_tutorial_camera_android_facebook_instruction: "<ul>\n    <li><div>With the biometric verification page of the application opened, press the <b>“three points”</b> button in the browser's upper right corner.</div></li>\n    <li><div>Select <b>Open with...</b> or <b>Open in Browser</b>, where <b>Browser</b> is your default browser (e.g., Chrome or any other browser).</div></li>\n    <li><div>Select <b>any browser</b> in the window that appears. The link to the biometric verification website will open in the browser app.</div></li>\n</ul>",
