  oz_tutorial_camera_android_firefox_browser: 'Firefox',
  oz_tutorial_camera_android_firefox_instruction: '<ul>\n    <li><div>In Firefox, hit the menu button (<b>“three points”</b>).</div></li>\n    <li><div>Locate <b>Settings</b>.</div></li>\n    <li><div>Select <b>Site permissions</b>.</div></li>\n    <li><div>Select <b>Camera</b>.</div></li>\n    <li><div>Select the <b>Always ask</b> option.</div></li>\n    <li><div>If Android still blocks the access, hit the <b>Go to Settings</b> button. In the <b>Settings</b> window, select <b>App permissions</b> and switch on the <b>Camera</b> radio button.</div></li>\n</ul>',
  oz_tutorial_camera_android_firefox_title: 'To enable the camera access in <b>Firefox</b> on an Android device, proceed as follows:',
  oz_tutorial_camera_android_instagram_browser: 'Instagram',
  oz_tutorial_camera_android_instagram_instruction: "<ul>\n    <li><div>With the biometric verification page of the application opened, hit the menu button (<b>“three points”</b>) in the browser's upper right corner.</div></li>\n    <li><div>Select <b>Open with...</b> or <b>Open in Browser</b> where <b>Browser</b> is your default browser (e.g., Chrome or any other browser).</div></li>\n    <li><div>Select <b>any browser</b> in the window that appears. A link to the biometric verification website will open in the browser app.</div></li>\n</ul>",
  oz_tutorial_camera_android_instagram_title: "If the camera doesn't turn on in the built-in <b>Instagram</b> browser, proceed as follows:",
  oz_tutorial_camera_android_miui_browser: 'Xiaomi Mi',
  oz_tutorial_camera_android_miui_instruction: '<ul>\n    <li><div>In the MI browser, tap the <b>Profile</b> button (a human icon in the lower right corner).</div></li>\n    <li><div>Tap the <b>Settings</b> button (a hexagon) near the number/name of your MI account.</div></li>\n    <li><div>Scroll down the settings page and select <b>Site settings</b>.</div></li>\n    <li><div>Select <b>Camera</b>.</div></li>\n    <li><div>Switch on the <b>Camera</b> radio button.</div></li>\n</ul>',
  oz_tutorial_camera_android_miui_title: 'To enable access to the camera in <b>Xiaomi Mi</b> browser, proceed as follows:',
  oz_tutorial_camera_android_opera_browser: 'Opera',
  oz_tutorial_camera_android_opera_instruction: '<ul>\n    <li><div>In <b>Opera</b>, click the <b>O</b> button in the browser’s lower right corner.</div></li>\n    <li><div>Select <b>Settings</b>.</div></li>\n    <li><div>In the <b>Confidentiality</b> section, select <b>Site settings</b>.</div></li>\n    <li><div>Select <b>Camera</b>.</div></li>\n    <li><div>Switch on the <b>Camera</b>  radio button and choose <b>Always ask</b>.</div></li>\n    <li><div>If the permission is accidentally canceled earlier, the site address is displayed in the <b>Canceled</b> section. Click <b>Clear permissions</b> to make the site request access to the camera when passing the biometric verification.</div></li>\n</ul>',
  oz_tutorial_camera_android_opera_title: 'To enable camera access in <b>Opera</b> browser on an Android device, proceed as follows:',
  oz_tutorial_camera_android_samsung_browser: 'Samsung',
  oz_tutorial_camera_android_samsung_instruction: '<ul>\n    <li><div>Hit the <b>Update permissions</b> button.</div></li>\n    <li><div>A permission request window will appear. In this window, click <b>Allow</b>. Then repeat the biometric verification.</div></li>\n</ul>\n<p>If you chose <b>Cancel</b> and flagged the <b>“Don’t ask me again”</b> option at some point, proceed as follows:</p>\n<ul>\n    <li><div>Hit the menu button (<b>“three stripes”</b> or <b>hamburger</b>) in the browser\'s lower right corner.</div></li>\n    <li><div>Select <b>Settings</b></div></li>\n    <li><div>Scroll down the settings page and select <b>About the Internet app</b></div></li>\n    <li><div>Tap the information button ("i") in the upper right corner to open the application data from the phone settings</div></li>\n    <li><div>Select <b>App permissions</b></div></li>\n    <li><div>Switch on the <b>Camera</b> radio button</div></li>\n</ul>\n<p><b>Cleaning up cash in the Samsung browser.</b><br>If the <b>Camera</b> radio button is switched on, but you still have no access request appeared, proceed as follows:</p>\n<ul>\n    <li><div>Hit the menu button (<b>“three stripes”</b> or <b>hamburger</b>) in the browser\'s lower right corner.</div></li>\n    <li><div>Select <b>Settings</b></div></li>\n    <li><div>Locate <b>Personal Information</b></div></li>\n    <li><div>Select <b>Clear browsing data</b></div></li>\n    <li><div>Flag the <b>Cash</b> and <b>Cookies and site data</b> options</div></li>\n    <li><div>Tap the <b>Clear</b> button </div></li>\n</ul>',
  oz_tutorial_camera_android_samsung_title: 'Unless the <b>Samsung</b> browser is allowed to use the camera in the phone settings, once you request to access the camera, the following message will appear: “Allow the Internet browser to access the camera to use it in this site”, accompanied by the <b>Update permissions</b> button.',
  oz_tutorial_camera_android_webview_browser: 'Built-in browser',
  oz_tutorial_camera_android_webview_instruction: '<ul><li><div>Go to <strong>Settings</strong> and open <strong>Apps</strong>. Then, access the application list (it might be labeled as <strong>App management</strong>, <strong>See all apps</strong>, etc.).</div></li><li><div>Select the application for which you want to enable camera access.</div></li><li><div>Tap on <strong>Permissions</strong> and locate the <strong>Camera</strong> option.</div></li><li><div>Allow camera access by selecting the appropriate option, which might be a checkbox, switch, or menu labeled as <strong>Allowed</strong>, <strong>Allow only while using the app</strong>, etc.</div></li></ul><p>The steps may vary slightly depending on the device. If you encounter any issues, try accessing the application using a different browser, such as Google Chrome, for enhanced compatibility.</p>',
