  oz_tutorial_camera_android_default_title: 'Біз Сіздің браузеріңізді танымадық, бірақ, мысалы, <b>Chrome</b> браузері үшін мәселені былай шешуге болады:',
  oz_tutorial_camera_android_edge_browser: 'Microsoft Edge',
  oz_tutorial_camera_android_edge_instruction: '<ul>\n<li><div>Мәзір түймесін басыңыз (<b>«үш жолақ»</b> немесе <b>гамбургер</b> ) шолғыштың төменгі оң жақ бұрышында.</div></li>\n<li><div>басыңыз <b>Параметрлер</b></div></li>\n<li><div>таңдаңыз <b>Құпиялылық және қауіпсіздік</b> .</div></li>\n<li><div>таңдаңыз <b>Сайт параметрлері</b> ішінде <b>Құпиялық</b> бөлім.</div></li>\n<li><div> Таңдау <b>Камера</b> жылы <b>Рұқсаттар</b> .</div></li>\n<li><div> орнатыңыз <b>Камера</b> ауыстырғыш <b>Қосулы</b> .</div></li>\n</ul>',
  oz_tutorial_camera_android_edge_title: 'Android құрылғыларында <b>Microsoft Edge</b> браузерінде камераға рұқсатты қосу үшін келесіні орындаңыз:',
  oz_tutorial_camera_android_facebook_browser: 'Facebook',
  oz_tutorial_camera_android_facebook_instruction: '<ul>\n    <li><div>Биометриялық тексерісі бар қосымша бетінен шықпай, браузердің оң жақ жоғарғы бұрышындағы <b>“үш нүкте”</b> батырмасын басыңыз.</div></li>\n    <li><div><b>...көмегімен ашу</b> тармағын немесе <b> Браузерде ашу</b> тармағын таңдаңыз, мұндағы <b>Браузер</b> - бұл Сіз тағайындаған келісім бойынша браузер (бұл Chrome және кез-келген басқа болуы мүмкін).</div></li>\n    <li><div>Пайда болған терезеде <b>кез-келген браузер</b> таңдаңыз. Биометриялық тексерісі бар сайтқа сілтеме браузер қосымшасында ашылады.</div></li>\n</ul>',
  oz_tutorial_camera_android_facebook_title: 'Егер камера <b>Facebook</b>-ке кіріктірілген браузерде қосылмаса, онда келесіні орындаңыз:',
  oz_tutorial_camera_android_firefox_browser: 'Firefox',
  oz_tutorial_camera_android_firefox_instruction: '<ul>\n    <li><div>Firefox браузерінде <b>“үш нүкте”</b> батырмасын басыңыз.</div></li>\n    <li><div><b>Баптамалар</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Сайттарға арналған рұқсаттар</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Камера</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Үнемі сұрау</b> нұсқасын таңдаңыз.</div></li>\n    <li><div>Егер Android рұқсатты әлі бұғаттаған болса, онда <b>Баптамаларға өту</b> батырмасын басыңыз, баптамалар терезесінде <b>Қосымшалар рұқсаттары</b> таңдаңыз, <b>Камера</b> ауыстырып-қосқышын қосылған күйге орнатыңыз.</div></li>\n</ul>',
  oz_tutorial_camera_android_firefox_title: 'Android құрылғыларында <b>Firefox</b> браузерінде камераға рұқсатты қосу үшін келесіні орындаңыз:',
  oz_tutorial_camera_android_instagram_browser: 'Инстаграм',
  oz_tutorial_camera_android_instagram_instruction: '<ul>\n    <li><div>Биометриялық тексерісі бар қосымша бетінен шықпай, браузердің оң жақ жоғарғы бұрышындағы <b>“үш нүкте”</b> батырмасын басыңыз.</div></li>\n    <li><div><b>...көмегімен ашу</b> тармағын немесе <b> Браузерде ашу</b> тармағын таңдаңыз, мұндағы <b>Браузер</b> - бұл Сіз тағайындаған келісім бойынша браузер (бұл Chrome және кез-келген басқа болуы мүмкін).</div></li>\n    <li><div>Пайда болған терезеде <b>кез-келген браузер</b> таңдаңыз. Биометриялық тексерісі бар сайтқа сілтеме браузер қосымшасында ашылады.</div></li>\n</ul>',
  oz_tutorial_camera_android_instagram_title: 'Егер камера <b>Инстаграм</b>-ға кіріктірілген браузерде қосылмаса, онда келесіні орындаңыз:',
  oz_tutorial_camera_android_miui_browser: 'Xiaomi Mi',
  oz_tutorial_camera_android_miui_instruction: '<ul>\n    <li><div>MI браузерінде <b>Профиль</b> батырмасын басыңыз (оң жақ төменгі бұрыштағы адам бейнесі бар батырма).</div></li>\n    <li><div>Сіздің МІ аккаунтыңыздың нөмірі/аты жанындағы <b>Баптамалар</b> батырмасын басыңыз (алтыбұрыш).</div></li>\n    <li><div>Баптамалар бетін төмен айналдырыңыз, <b>Сайттар баптамалары</b> батырмасын басыңыз.</div></li>\n    <li><div><b>Камера</b> тармағын таңдаңыз.</div></li>\n    <li><div><b> Камера</b> тармағында ауыстырып-қосқышты қосылған күйге орнатыңыз.</div></li>\n</ul>',
  oz_tutorial_camera_android_miui_title: '<b>Xiaomi MI</b> браузерінде камераға рұқсат беру үшін келесіні орындаңыз:',
  oz_tutorial_camera_android_opera_browser: 'Opera',
  oz_tutorial_camera_android_opera_instruction: '<ul>\n    <li><div><b>Opera</b> браузерінде оң жақ төменгі бұрыштағы <b>O батырмасын</b> басыңыз.</div></li>\n    <li><div><b>Баптамалар</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Құпиялылық</b> бөлімінде <b>Сайттың баптамалары</b> тарамағын таңдаңыз.</div></li>\n    <li><div><b>Камера</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Камера</b> ауыстырып-қосқышын қосылған күйге орнатыңыз - <b>үнемі сұрау</b>.</div></li>\n    <li><div>Егер бұрын байқамай рұқсаттан бас тартқан болсаңыз, онда сайттың адресі <b>Бас тартылды</b> бөлімінде көрсетілетін болады. <b>РҰҚСАТТАРДЫ ТҮСІРУ</b>-ді басыңыз, және биометриялық тексерістен өту кезінде сайт қайтадан камераға рұқсатты сұрайды.</div></li>\n</ul>',
  oz_tutorial_camera_android_opera_title: 'Android құрылғыларында <b>Opera</b> браузерінде камераға рұқсатты қосу үшін, келесіні орындаңыз:',
  oz_tutorial_camera_android_samsung_browser: 'Samsung',
  oz_tutorial_camera_android_samsung_instruction: '<ul>\n    <li><div>Рұқсаттарды <b>Жаңарту</b> батырмасын басыңыз.</div></li>\n    <li><div>Рұқсат сұраған терезе пайда болады. Онда <b>Рұқсат беру</b>-ді басыңыз. Және биометриялық тексеріс процессінен қайта өтіп көріңіз.</div></li>\n</ul>\n<p>Егер алдында <b>Бас тарту</b>-ды басып және <b>“Бұдан былай сұрамау”</b> қанатбелгісін қойған болсаңыз, келесіні орындаңыз:</p>\n<ul>\n    <li><div>Браузердегі оң жақ төмен бұрыштағы <b>“үш жолақ”</b> батырмасын басыңыз.</div></li>\n    <li><div><b>Баптамалар</b> тармағын таңдаңыз.</div></li>\n    <li><div>Баптамалар бетін төмен айналдырыңыз, <b>“Интернет” қосымшасы туралы</b> басыңыз. </div></li>\n    <li><div>Оң жақ жоғарғы бұрыштағы i (ақпарат) батырмасын басыңыз, телефон баптамаларынан қосымша туралы ақпараты бар терезе ашылады</div></li>\n    <li><div><b>Қосымшалар рұқсаттары</b> тармағын таңдаңыз</div></li>\n    <li><div><b>Камера</b> ауыстырып-қосқышын қосылған күйге орнатыңыз</div></li>\n</ul>\n<p><b>Самсунг браузерінің кэшін тазарту.</b><br>Егер <b>Камера</b> ауыстырып-қосқышы қосылған болса, ал сайтта қолжетімділікке рұқсат сұрауы пайда болмаса, онда:</p>\n<ul>\n    <li><div>Браузердегі оң жақ төмен бұрыштағы <b>“үш жолақ”</b> батырмасын басыңыз.</div></li>\n    <li><div><b>Баптамалар</b> тармағын таңдаңыз.</div></li>\n    <li><div>Сосын <b>Жеке деректер</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Қарау туралы деректерді жою</b> тармағын таңдаңыз.</div></li>\n    <li><div>Тармақты таңдаңыз.</div></li>\n    <li><div>Келесі тармақтарды таңдалынған күйде қалдырыңыз: <b>Кэш</b> және <b>Cookie және сайттар деректері</b></div></li>\n    <li><div><b>Жою</b> батырмасын басыңыз.</div></li>\n</ul>',
  oz_tutorial_camera_android_samsung_title: 'Егер <b>Samsung</b> браузеріне телефон баптамаларында камераны пайдалануға рұқсат ұсынылмаған болса, онда камераға рұқсатты сұрау кезінде “Осы сайтта оны пайдалану үшін браузерге камераға Internet рұқсатты ұсыныңыз” хабары және <b>Рұқсаттарды жаңарту</b> батырмасы пайда болады.',
  oz_tutorial_camera_android_webview_browser: 'Кірістірілген браузер',
  oz_tutorial_camera_android_webview_instruction: '<ul><li><div>Бару<strong> Параметрлер</strong> және ашық<strong> Қолданбалар</strong> . Содан кейін қолданбалар тізіміне кіріңіз (ол келесідей белгіленуі мүмкін<strong> Қолданбаны басқару</strong> ,<strong> Барлық қолданбаларды қараңыз</strong> , т.б.).</div></li><li><div> Камераға кіру мүмкіндігін қосқыңыз келетін қолданбаны таңдаңыз.</div></li><li><div> түртіңіз<strong> Рұқсаттар</strong> және орнын табыңыз<strong> Камера</strong> опция.</div></li><li><div> Белгіленген құсбелгі, қосқыш немесе мәзір болуы мүмкін сәйкес опцияны таңдау арқылы камераға кіруге рұқсат беріңіз<strong> Рұқсат</strong> ,<strong> Қолданбаны пайдалану кезінде ғана рұқсат етіңіз</strong> , т.б.</div></li></ul><p> Қадамдар құрылғыға байланысты аздап өзгеруі мүмкін. Қандай да бір мәселеге тап болсаңыз, қосымша үйлесімділік үшін Google Chrome сияқты басқа шолғышты пайдаланып қолданбаға кіріп көріңіз.</p>',
  oz_tutorial_camera_android_webview_title: 'Android құрылғыңыздағы қолданбаға камераға кіру мүмкіндігін қосу үшін мына қадамдарды орындаңыз:',
  oz_tutorial_camera_android_yandex_browser: 'Яндекс браузері',
  oz_tutorial_camera_android_yandex_instruction: '<ul>\n    <li><div>Биометриялық тексерісі бар қосымша бетінен шықпай, браузердің оң жақ төмен бұрышындағы <b>“үш нүкте”</b> батырмасын басыңыз.</div></li>\n    <li><div><b>Сайт туралы</b> тармағын таңдаңыз.</div></li>\n    <li><div><b>Камера</b> ауыстырып-қосқышын қосылған күйге орнатыңыз.</div></li>\n</ul>',
