  oz_tutorial_camera_android_chrome_title: 'Чтобы включить доступ к камере в браузере <b>Google Chrome</b>, сделайте следующее:',
  oz_tutorial_camera_android_chrome_with_screens_title: 'Для продолжения разрешите доступ к камере в настройках браузера',
  oz_tutorial_camera_android_default_browser: 'Chrome',
  oz_tutorial_camera_android_default_instruction: '<ul>\n    <li><div>В браузере <b>Chrome</b> нажмите на кнопку <b>“три точки”</b>.</div></li>\n    <li><div>Выберите пункт <b>Настройки</b>.</div></li>\n    <li><div>Прокрутите страницу настроек вниз, выберите пункт <b>Настройки сайтов</b>.</div></li>\n    <li><div>Выберите пункт <b>Камера</b>.</div></li>\n    <li><div>Установите переключатель во включенное состояние в пункте <b>Камера</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_default_title: 'Мы не узнаем Ваш браузер, но, например, для браузера <b>Chrome</b> решить проблему можно так:',
  oz_tutorial_camera_android_edge_browser: 'Microsoft Edge',
  oz_tutorial_camera_android_edge_instruction: '<ul>\n<li><div>Нажмите на кнопку <b>"три полоски"</b> в правом нижнем углу в браузере.</div></li>\n<li><div>Нажмите <b>Настройки</b>.</div></li>\n<li><div>Выберите пункт <b>Конфиденциальность и защита</b>.</div></li>\n<li><div>Выберите пункт <b>Настройки сайта</b> в разделе <b>Конфиденциальность</b>.</div></li>\n<li><div>Выберите пункт <b>Камера</b> в разделе <b>Разрешения</b>.</div></li>\n<li><div>Установите переключатель в пункте <b>Камера</b> во включенное состояние.</div></li>\n</ul>',
  oz_tutorial_camera_android_edge_title: 'Чтобы включить доступ к камере в браузере <b>Microsoft Edge</b> на устройствах Android, сделайте следующее:',
  oz_tutorial_camera_android_facebook_browser: 'Facebook',
  oz_tutorial_camera_android_facebook_instruction: '<ul>\n    <li><div>Не покидая страницу приложения с биометрической проверкой, нажмите в правом верхнем углу браузера кнопку <b>“три точки”</b>.</div></li>\n    <li><div>Выберите пункт <b>Открыть с помощью ...</b> или пункт <b>Открыть в Браузер</b>, где <b>Браузер</b> - это назначенный Вами браузер по умолчанию (это может быть Chrome и любой другой).</div></li>\n    <li><div>Выберите в появившемся окне <b>любой браузер</b>. Ссылка на сайт с биометрической проверкой откроется в приложении браузера.</div></li>\n</ul>',
  oz_tutorial_camera_android_facebook_title: 'Если камера не включается во встроенном в <b>Facebook</b> браузере, то сделайте следующее:',
  oz_tutorial_camera_android_firefox_browser: 'Firefox',
  oz_tutorial_camera_android_firefox_instruction: '<ul>\n    <li><div>В браузере Firefox нажмите на кнопку <b>“три точки”</b>.</div></li>\n    <li><div>Выберите пункт <b>Настройки</b>.</div></li>\n    <li><div>Выберите пункт <b>Разрешения для сайтов</b>.</div></li>\n    <li><div>Выберите пункт <b>Камера</b>.</div></li>\n    <li><div>Выберите вариант <b>Всегда спрашивать</b>.</div></li>\n    <li><div>Если разрешение все еще заблокировано Android, то нажмите кнопку <b>Перейти в Настройки</b>, в окне настроек выберите <b>Разрешения приложений</b>, установите переключатель <b>Камера</b> во включенное состояние.</div></li>\n</ul>',
  oz_tutorial_camera_android_firefox_title: 'Чтобы включить доступ к камере в браузере <b>Firefox</b> на устройствах Android, сделайте следующее:',
  oz_tutorial_camera_android_instagram_browser: 'Инстаграм',
  oz_tutorial_camera_android_instagram_instruction: '<ul>\n    <li><div>Не покидая страницу приложения с биометрической проверкой, нажмите в правом верхнем углу браузера кнопку <b>“три точки”</b>.</div></li>\n    <li><div>Выберите пункт <b>Открыть с помощью ...</b> или пункт <b>Открыть в Браузер</b>, где <b>Браузер</b> - это назначенный Вами браузер по умолчанию (это может быть Chrome и любой другой).</div></li>\n    <li><div>Выберите в появившемся окне <b>любой браузер</b>. Ссылка на сайт с биометрической проверкой откроется в приложении браузера.</div></li>\n</ul>',
  oz_tutorial_camera_android_instagram_title: 'Если камера не включается во встроенном в <b>Инстаграм</b> браузере, то сделайте следующее:',
  oz_tutorial_camera_android_miui_browser: 'Xiaomi Mi',
  oz_tutorial_camera_android_miui_instruction: '<ul>\n    <li><div>В MI браузере нажмите кнопку <b>Профиль</b> (кнопка с человечком в правом нижнем углу).</div></li>\n    <li><div>Нажмите кнопку <b>Настройки</b> рядом с номером/именем Вашего MI аккаунта (шестиугольник).</div></li>\n    <li><div>Прокрутите страницу настроек вниз, нажмите пункт <b>Настройки сайтов</b>.</div></li>\n    <li><div>Выберите пункт <b>Камера</b>.</div></li>\n    <li><div>Установите переключатель во включенное состояние в пункте <b>Камера</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_miui_title: 'Чтобы включить доступ к камере в браузере <b>Xiaomi MI</b>, сделайте следующее:',
  oz_tutorial_camera_android_opera_browser: 'Opera',
  oz_tutorial_camera_android_opera_instruction: '<ul>\n    <li><div>В браузере <b>Opera</b> нажмите на <b>кнопку O</b> в правом нижнем углу.</div></li>\n    <li><div>Выберите пункт <b>Настройки</b>.</div></li>\n    <li><div>Выберите пункт <b>Настройки сайта</b> в разделе <b>Конфиденциальность</b>.</div></li>\n    <li><div>Выберите пункт <b>Камера</b>.</div></li>\n    <li><div>Установите переключатель <b>Камера</b> во включенное состояние - <b>Всегда спрашивать</b>.</div></li>\n    <li><div>Если ранее случайно отклонили разрешение, то адрес сайта будет отображаться в разделе <b>Отклонено</b>. Нажмите\n        <b>СБРОСИТЬ РАЗРЕШЕНИЯ</b>, и сайт снова запросит доступ к камере при прохождении биометрической проверки.</div></li>\n</ul>',
  oz_tutorial_camera_android_opera_title: 'Чтобы включить доступ к камере в браузере <b>Opera</b> на устройствах Android, сделайте следующее:',
  oz_tutorial_camera_android_samsung_browser: 'Samsung',
  oz_tutorial_camera_android_samsung_instruction: '<ul>\n    <li><div>Нажмите на кнопку <b>Обновить</b> разрешения.</div></li>\n    <li><div>Появится окно с запросом разрешения. Нажмите в нем <b>Разрешить</b>. И попробуйте пройти процесс биометрической\n        проверки заново.</b></div></li>\n</ul>\n<p>Если ранее нажимали <b>Отклонить</b> и ставили галочку <b>“Больше не спрашивать”</b>, то сделайте следующее:</p>\n<ul>\n    <li><div>Нажмите на кнопку <b>“три полоски”</b> в правом нижнем углу в браузере.</div></li>\n    <li><div>Выберите пункт <b>Настройки</b></div></li>\n    <li><div>Прокрутите страницу настроек вниз, нажмите <b>О приложении “Интернет”</b></div></li>\n    <li><div>Нажмите кнопку i (информация) в правом верхнем углу, откроется окно с информацией о приложении из настроек\n        телефона</div></li>\n    <li><div>Выберите пункт <b>Разрешения приложений</b></div></li>\n    <li><div>Установите переключатель <b>Камера</b> во включенное состояние</div></li>\n</ul>\n<p><b>Очистка кэша Самсунг браузера.</b><br>Если переключатель <b>Камера</b> включен, а запрос разрешения на доступ на\n    сайте не появляется, то:</p>\n<ul>\n    <li><div>Нажмите на кнопку <b>“три полоски”</b> в правом нижнем углу в браузере.</div></li>\n    <li><div>Выберите пункт <b>Настройки</b></div></li>\n    <li><div>Далее выберите пункт <b>Личные данные</b></div></li>\n    <li><div>Выберите пункт <b>Удаление данных о просмотре</b></div></li>\n    <li><div>Оставьте выбранными пункты: <b>Кэш</b> и <b>Cookie и данные сайтов</b></div></li>\n    <li><div>Нажмите кнопку <b>Удалить</b></div></li>\n</ul>',
  oz_tutorial_camera_android_samsung_title: 'Если <b>Samsung</b> браузеру не было предоставлено разрешение на использование камеры в настроеках телефона, то при запросе доступа к камере появится сообщение “Предоставьте браузеру Internet доступ к камере, чтобы пользоваться ею на этом сайте” и кнопка <b>Обновить разрешения</b>.',
  oz_tutorial_camera_android_webview_browser: 'Встроенный браузер',
  oz_tutorial_camera_android_webview_instruction: '<ul><li><div>Зайдите в <strong>Настройки</strong> и откройте <strong>Приложения</strong>. Перейдите к списку приложений (он может называться <strong>Управление приложениями</strong>, <strong>Просмотр приложений</strong>, и т. д.).</div></li><li><div>Выберите приложение, для которого нужно включить доступ к камере</div></li><li><div>Коснитесь пункта <strong>Разрешения</strong> и найдите настройку <strong>Камера</strong>.</div></li><li><div>Разрешите доступ к камере, выбрав соответствующую опцию (флажок, переключатель или меню). Она может называться <strong>Разрешить</strong>, <strong>Разрешить при использовании приложения</strong>, и т. д.</div></li></ul><p>В зависимости от устройства шаги могут немного отличаться. Если в процессе возникнут сложности, попробуйте зайти в приложение через другой браузер, например Google Chrome, для лучшей совместимости.</p>',
  oz_tutorial_camera_android_webview_title: 'Чтобы включить доступ к камере для приложения на устройстве Android, выполните следующие действия:',
  oz_tutorial_camera_android_yandex_browser: 'Яндекс',
  oz_tutorial_camera_android_yandex_instruction: '<ul>\n    <li><div>Не покидая страницу приложения с биометрической проверкой, нажмите в правом нижнем углу браузера кнопку <b>“три точки”</b>.</div></li>\n    <li><div>Выберите пункт <b>О сайте</b>.</div></li>\n    <li><div>Установите переключатель <b>Камера</b> во включенное состояние.</div></li>\n</ul>',
  oz_tutorial_camera_android_yandex_title: 'Чтобы включить доступ к камере в <b>Яндекс</b> браузере на устройствах Android, сделайте следующее:',
  oz_tutorial_camera_desktop_chrome_browser: 'Google Chrome',
  oz_tutorial_camera_desktop_chrome_instruction: '<ul>\n    <li><div>Перейдите в меню <b>Настройка и управление Google Chrome</b>, нажав в браузере кнопку с тремя точками в правом верхнем углу</div></li>\n    <li><div>Выберите пункт <b>Настройки</b> в выпадающем меню</div></li>\n    <li><div>В разделе <b>Конфиденциальность и безопасность</b> выберите пункт <b>Настройки сайтов</b></div></li>\n    <li><div>В области <b>Разрешения</b> выберите пункт <b>Камера</b></div></li>\n    <li><div>Проверьте, что в области <b>Настройки по умолчанию</b> выбран пункт <b>Разрешить сайтам отправлять запрос на использование камеры</b>.</div></li>\n    <li><div>Если наш сайт указан в разделе <b>Запретить сайтам использовать камеру</b>, удалите его оттуда</div></li>\n</ul>',
